import React from 'react';
import logo from './logo.svg';
import './App.css';
import Nav from './Nav.js';
import HomeCard from './HomeCard.js';


class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      homeCards:[]
    };
    var self = this;
    fetch('http://localhost:3001/',{
    mode:'cors'
    })
    .then(response => response.json())
    .then(data => {
      self.setState({
        homeCards:data.homecards
      });
      console.log(self.state.homeCards);
    });
  }
  render() {
    console.log(this.state.homeCards);
    return (
      <div className="App">
      <Nav />
      <div></div>
      {this.state.homeCards.map(card => <HomeCard card={card}/>)}
    </div>
    );
  }
}

export default App;
